import './Icon.css';
import { VscCheck } from 'react-icons/vsc';
import { TweenMax } from 'gsap';

// Return Icon
export default function ReturnICon() {

 React.useEffect(() => {
  TweenMax.from('.wrp-success-icon', 2, { delay: 1.2, opacity: 0, });
 }, [])

 return (
  <div className='wrp-success-icon'>
   <VscCheck size={'2em'} />
  </div>
 );
};
